import React, { useState } from "react";
import "../css/MoodTracker.css";

const MoodTracker = () => {
  // Define initial data structure for mood ratings
  const initialMoodData = [
    {
      date: "2024-05-17",
      emotions: { Happy: null, Sad: null, Angry: null, Excited: null },
    },
    {
      date: "2024-05-18",
      emotions: { Happy: null, Sad: null, Angry: null, Excited: null },
    },
    // Add more dates as needed
  ];

  // State to manage mood data
  const [moodData, setMoodData] = useState(initialMoodData);

  // Function to handle mood rating
  const handleMoodRating = (date, emotion, rating) => {
    // Update the mood data with the new rating
    const updatedMoodData = moodData.map((entry) => {
      if (entry.date === date) {
        return {
          ...entry,
          emotions: {
            ...entry.emotions,
            [emotion]: rating,
          },
        };
      }
      return entry;
    });
    setMoodData(updatedMoodData);
  };

  return (
    <div>
      <h2>Mood Tracker</h2>
      <table>
        <thead>
          <tr>
            <th>Date</th>
            <th>Happy</th>
            <th>Sad</th>
            <th>Angry</th>
            <th>Excited</th>
          </tr>
        </thead>
        <tbody>
          {moodData.map((entry) => (
            <tr key={entry.date}>
              <td>{entry.date}</td>
              {Object.entries(entry.emotions).map(([emotion, rating]) => (
                <td key={emotion}>
                  <button
                    onClick={() => handleMoodRating(entry.date, emotion, 10)}
                  >
                    10
                  </button>
                  {/* Add more rating buttons or input fields as needed */}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default MoodTracker;
